import React from 'react';
import mainPagePic from './pics/töödeldud3.jpg';

import './css/main.css';

const Article = (props) => {
    return(
        <section>
            <h4>Title</h4>
            <p>{props.sisu}</p>
        </section>
    );
}

const Main = () => {
    return(
        <section className="main">
            <h4>Hello guys</h4>
            <Article sisu="joujou" />
            <Article sisu="heloasdf" />
            <section className="about">
                <h6>Mait Jurask</h6>
                <img src="" alt="Signature placeholder"/>
            </section>
        </section>
    );
};

export default Main;
